import React, { Component } from 'react';
import styled from '@emotion/styled'
import {
  Flex,
  Box,
  Heading,
  Text,
  Button,
  Link as A,
} from 'rebass'

class DemoIndex extends Component {

  render() {
    return (
      <Flex
        bg="black"
        color="white"
        flexDirection="column"
        alignItems="center"
        justifyContent="center"
        className="sweetmenu__demo">
        <Box className="sweetmenu__demo--container">
          <Heading
            fontFamily="body"
            fontWeight="bold"
            fontSize={[6,6,6,8]}
            className="sweetmenu__demo--title">
            Welcome
          </Heading>
        </Box>
      </Flex>
    );
  }

}

export default DemoIndex;
